    TextStyle,
} from '@shopify/polaris';

class Login extends React.Component {
    render(){
        return (
            <Page>
                <Layout>
                    <Button>Signin With Instagram</Button>
                </Layout>
            </Page>
        );
    }
}

export default Login;
